import React from "react";
import axios from "axios";

const ViewPost = ({ post }) => {
  console.log(post);
  return <div></div>;
};

export default ViewPost;

ViewPost.getInitialProps = ({ query: { postid } }) => {
  axios
    .get(`/api/posts/${postid}`)
    .then((res) => {
      console.log(res);
    })
    .catch((err) => {
      console.log(err);
    });

  return { post: "test" };
};
